import ReactDOM from 'react-dom';

const New = () =>{
  return(
    <div>
      <h1>Application Form</h1>
      <label>
        Name:
        <input type="text" />
        Id:
        <input type="text" />
        Password
        <input type="text" />
      </label>
    </div>
  )
}

export default New;
